        return new Source("{% extends 'base.html.twig' %}

{% block title %}Experience index{% endblock %}

{% block body %}
<section class=\"ftco-section bg-light\">
    <div class=\"container\">
    <h1>Experience</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Libelle</th>
                <th>Societe</th>
                <th>TypeContrat</th>
                <th>StartDate</th>
                <th>EndDate</th>
                <th>Description</th>
                <th>Location</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for experience in experiences %}
            <tr>
                <td>{{ experience.id }}</td>
                <td>{{ experience.libelle }}</td>
                <td>{{ experience.societe }}</td>
                <td>{{ experience.typeContrat }}</td>
                <td>{{ experience.startDate ? experience.startDate|date('Y-m-d') : '' }}</td>
                <td>{{ experience.endDate ? experience.endDate|date('Y-m-d') : '' }}</td>
                <td>{{ experience.description }}</td>
                <td>{{ experience.location }}</td>
                <td>
                    <a href=\"{{ path('admin_experience_edit', {'id': experience.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"9\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('admin_experience_new') }}\">Create new</a>
    </div>
</section>
{% endblock %}
", "admin/experience/index.html.twig", "C:\\xampp\\htdocs\\www\\Sites\\Ecole\\PPE\\mainSite\\templates\\admin\\experience\\index.html.twig");
